import React from 'react';
import {List, Button} from 'semantic-ui-react';

class audit extends React.Component{



	runtest(){

        let contractCode = this.props.contractCode;
        console.log("contractCode is " + contractCode);
        let dataArray = contractCode.split("\n");

        return dataArray[0];


    }

    viewCode=()=>{
        let contractCode = this.props.contractCode;
        console.log("contractCode is " + contractCode);
        let dataArray = contractCode.split("\n");

        return dataArray[0];

    }




        render(){
        return (
                    <List divided relaxed>

                    <div>{this.runtest}</div>

                          <List.Item>
                              <List.Content>
                                <List.Header >{this.runtest()}</List.Header>
                                <List.Description as='a'>Updated 10 mins ago</List.Description>
                              </List.Content>
                        </List.Item>

                        <List.Item>
                          <List.Content>
                            <List.Header as='a'>Semantic-Org/Semantic-UI-Docs</List.Header>
                            <List.Description as='a'>Updated 22 mins ago</List.Description>
                          </List.Content>
                        </List.Item>
                        <Button onClick={this.viewCode}>View Code</Button>





                    </List>
            );
    }

    }

export default audit;
